Urban Renewal Areas for the City of Porltand, Oregon. Maintained by Portland Development Commission 

&quot;Urban renewal is a state-sanctioned program designed to help communities improve and redevelop areas that are physically deteriorated, unsafe, or poorly planned. The Portland Development Commission (PDC), the city's urban renewal agency, uses urban renewal as a tool to help specific areas of the city realize capital projects - parks, streetscape improvements, community centers, and the like - that would not happen on their own.&quot; 

These data are distributed uner the terms of the City of Portland Data Distribution Policy.
